import React from 'react';
import { Story } from '../services/api';

interface StoryGridProps {
  stories: Story[];
  onDelete?: (storyId: string) => void;
}

const StoryGrid: React.FC<StoryGridProps> = ({ stories, onDelete }) => {
  console.log('StoryGrid received stories:', JSON.stringify(stories, null, 2));

  return (
    <div style={{
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fill, minmax(300px, 1fr))',
      gap: '20px',
      padding: '20px'
    }}>
      {stories.map((story) => {
        // Use story_id if available, fallback to id
        const storyId = story.story_id || story.id;
        console.log('Processing story:', { storyId, story });

        return (
          <div
            key={storyId}
            style={{
              background: 'rgba(255, 255, 255, 0.1)',
              borderRadius: '10px',
              padding: '20px',
              color: 'white'
            }}
          >
            <h3>{story.title || story.story_title}</h3>
            <p style={{ whiteSpace: 'pre-wrap' }}>{story.content || story.story_text}</p>
            {story.images && story.images.length > 0 && (
              <img
                src={story.images[0]}
                alt={story.title || story.story_title}
                style={{
                  width: '100%',
                  height: '200px',
                  objectFit: 'cover',
                  borderRadius: '5px',
                  marginTop: '10px'
                }}
              />
            )}
            {onDelete && (
              <button
                onClick={() => onDelete(storyId)}
                style={{
                  marginTop: '10px',
                  padding: '5px 10px',
                  background: '#ff4444',
                  border: 'none',
                  borderRadius: '5px',
                  color: 'white',
                  cursor: 'pointer'
                }}
              >
                Delete
              </button>
            )}
          </div>
        );
      })}
    </div>
  );
};

export default StoryGrid;
